
Rebelde Way is set in the Elite Way School, a prestigious private boarding high school near Buenos Aires. The students of the school are the members of Argentine wealthiest families, as well as gifted students with scholarships. The series follows the lives of Elite Way students, their parents and their professors, and it also features the regular use of English language and phrases by the upper class. Its central characters are Marizza Pía Spirito, Mía Colucci, Pablo Bustamante and Manuel Aguirre, portrayed by, r',235.746,2,318,'/wu4Vi93RxaE1kkFM5ClmcVzkIby.jpg',24, 8.4,'2002-05-27', '2003-11-13', '');

The Netflix version has combined some episodes and that is why that version only has 74 episodes whilst the original has 113 episodes.',188.253,1,113,'/jZqm7HFuxfH9P0LFjQZ8nzrCUHP.jpg',2207, 7.5,'2012-05-28', '2012-11-19', '');

Betty, la Fea re-aired on Spanish-language U.S. network TeleFutura in January 2009. Eight years after the telenovela\'s original run, the highly anticipated return of the original version of Yo Soy Betty, La Fea delivered impressive ratings for the network, attracting over one million viewers, more than half a million of which were adults aged 18–49. In addition, the premiere episode doubled and in some cases nearly tripled its prior audience among all key demographics.

Due to the success of re-runs aired in the United States, in June 2009, Yo soy Betty, la fea re-aired in México on Canal de las Estrellas.',173.603,1,335,'/iEBOiXiDGaxVR6w8aKgG5MEusuO.jpg',2003, 8.2,'1999-10-25', '1999-12-23', '');
