INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(62715,'Dragon Ball Super','With Majin Boo defeated half-a-year prior, peace returns to Earth, where Son Goku (now a radish farmer) and his friends now live peaceful lives. However, a new threat appears in the form of Beerus, the God of Destruction. Considered the most terrifying being in the entire universe, Beerus is eager to fight the legendary warrior seen in a prophecy foretold decades ago known as the Super Saiyan God. The series retells the events from the two Dragon Ball Z films, Battle of Gods and Resurrection \'F\' before proceeding to an original story about the exploration of alternate universes.',161.925,1,131,'/kbhu0tIv5E1PbAw2YPjrhoQ7I1s.jpg',2966, 8.2,'2015-07-05', '2018-03-25', '');
