INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(62643,'DC\'s Legends of Tomorrow','When heroes alone are not enough ... the world needs legends. Having seen the future, one he will desperately try to prevent from happening, time-traveling rogue Rip Hunter is tasked with assembling a disparate group of both heroes and villains to confront an unstoppable threat — one in which not only is the planet at stake, but all of time itself. Can this ragtag team defeat an immortal threat unlike anything they have ever known?',153.551,6,97,'/uzQpQGISbtxc047IOssFo5AiDwU.jpg',1591, 7.2,'2016-01-21', '2021-05-16', 'Their time is now.');
